function addEvaluator() {
    new lively.bindings.FRPCore.Evaluator().installTo(this.get("FRPTest"));
    this.get("FRPTest").__evaluator.syncWithRealTime = true;
    this.get("FRPTest").__evaluator.evaluate(); // to set currentTime
}

