function deleteStreamsAndEvaluator() {
    for (var k in this.get("FRPTest")) {
        if (this.get("FRPTest")[k] instanceof
                lively.bindings.FRPCore.EventStream) {
            this.get("FRPTest")[k].uninstall();
        }
    }
    delete this.get("FRPTest").__evaluator;
}

265.source:
function resetHeadings() {
    for (var k in this.get("FRPTest")) {
        if (k.match('^heading')) {
            this.get("FRPTest")[k].currentValue = 0;
            this.get("FRPTest")[k].sync();
        }
    }
}

268.source:
function makeArms() {
    var last = lively.morphic.Morph.makeRectangle(pt(0, 0).extent(pt(10, 10)));
    var i = 1;
    last.setFill(Color.random());
    last.setExtent(pt(120, 10));
    last.setBorderWidth(0);
    last.setName("Arm" + i);
    this.addMorph(last);
    for (i = 2; i <= 6; i++) {
        var current = lively.morphic.Morph
            .makeRectangle(pt(0, 0).extent(pt(10, 10)));
        current.setFill(Color.random());
        current.setExtent(pt(120/i, 10));
        current.setBorderWidth(0);
        current.setName("Arm" + i);
        last.addMorph(current);
        current.setPosition(pt(last.getExtent().x, 0));
        last = current;
    }
}

