function makeConnections() {
    var s = this.get("FRPTest");
    for (var i = 1; i <= 6; i++) {
        s.frpConnect('heading' + i, 'Arm' + i, 'frpRotation');
        s.frpConnect('length' + i, 'Arm' + i, 'frpWidth');
    }
}
